// App.js

import React, { useState } from 'react';
import './App.css';

function App() {
  const [status, setStatus] = useState('');

  const startDetection = () => {
    // Add logic to start detection
    setStatus('Detection started');
  };

  const endDetection = () => {
    // Add logic to end detection
    setStatus('Detection ended');
  };

  return (
    <div className="App">
      <h1>Drowsiness Detection System</h1>
      <div className="buttons">
        <button onClick={startDetection}>Start Detection</button>
        <button onClick={endDetection}>End Detection</button>
      </div>
      <p>Status: {status}</p>
    </div>
  );
}

export default App;
